INSERT INTO `event` VALUES (3,'TECHNO-FIFA','techno-fifa','competitions','NULL','\nA football gaming competition where best players lock horns against each other with comparable teams where the winner is decided by knock out method.\n\n',77.40871100,23.21784200,'2017-10-08 15:59:32','ADARSH YADAV','addy.yadav178@gmail.com','9993876958','Civil, 3rd Year','','','','','','2017-10-01 20:18:40','2017-10-08 15:59:32'),(4,'CIVIL BRIDGE','civil-bridge','competitions','NULL','A 2-day event in which the participants are required to make a Cantilever bridge using popsicle sticks\n',77.40871100,23.21784200,'2017-10-15 11:55:15','Shivam Dudharia','shivamdudharia@gmail.com','9993876958','civil 3rd year','','','','','','2017-10-01 20:25:32','2017-10-01 20:25:32'),(6,'RANGMANCH','rangmanch','competitions','NULL','A \'performing arts\' competition on themes that revolve around the latest technological changes in the country.\n\n\n',77.40710400,23.21659000,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:48:44','2017-10-01 20:48:44'),(7,'10 IS 2','10-is-2','competitions','NULL','A Computer Science based quiz competition which puts forward the revolutionary ideas and\ntechnical advancements in the field of artificial intelligence\n\n\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:50:38','2017-10-01 20:50:38'),(8,'KODACHROME','kodachrome','exhibitions','NULL','A bi-annual theme based photo exhibition that invites entries from all the college students. \n\n\n\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:52:22','2017-10-12 15:31:04'),(10,'ILLUMINATI','illuminati','competitions','NULL','A 3-day literary event that revolves around the concept of illuminati, a secret society that opposes obscurantism. Participants work as its member to solve cases of deliberate vagueness and mysteries.\n\n\n\n\n',77.40707100,23.21592400,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:54:58','2017-10-01 20:54:58'),(11,'Market Guru 6.0','market-guru-60','competitions','NULL','Market Guru aims to award and acknowledge participants who excel at market analysis.Events are \ndesigned in order to check business acumen and algorithm decoding skills of the participants.\n\n\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:56:21','2017-10-01 20:56:21'),(13,'Pandora’s Box 2.0','pandoras-box-20','competitions','NULL','As the name suggests, Pandora\'s Box fabricates evils in the form of literary hurdles that will check the participants\' knowledge of literature and eloquence of speech.\n\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 20:57:53','2017-10-01 20:57:53'),(14,'AIR MARSHAL','air-marshal','competitions','NULL','This is a competition of RC planes where they will race each other for the maximum time in the zero throttle condition. In the second part of the event the planes have to cross through a given arena and the plane which takes least time will win',77.40835100,23.21629300,'0000-00-00 00:00:00','Shubham Tiwari ','Shubhammanit2908@gmail.com','9479860353','NULL',' Vaibhav Jain','','704721182','','','2017-10-01 20:59:07','2017-10-09 11:16:14'),(15,'PROPULSION','propulsion','competitions','NULL','The water rockets will hit the sky and the physics behind the water rockets will give you the feel of application of Newton’s law in real. The second part of competition consists of obtaining maximum range of water rockets. Do attend the event, learn and enjoy the fun.',77.40835100,23.21629300,'0000-00-00 00:00:00','Shreya Chourasia','NULL@null.com','700779889','NULL','Vaidehi Padmakar','','7247373286','','','2017-10-01 21:00:30','2017-10-09 11:16:44'),(16,'HOVERRUN','hoverrun','competitions','NULL',' In this event you will see the fight between the hovercrafts for reaching to maximum height and to become fastest. The hover will cover the given arena in their least possible time and the race of reaching at maximum possible will double the fun. It is a technical event but as the races are always fun so do come with your hover and participate in the battle.',77.40835100,23.21629300,'0000-00-00 00:00:00','Satya Deo Nirala    ','Satyalalitpur123@gmail.com','8349603217','NULL','Alankrit Gupta','alankritguptav1@gmail.com','9479860446','','','2017-10-01 21:02:32','2017-10-09 11:07:23'),(17,'CRIME ALLEY 2','crime-alley-2','competitions','NULL','A muder mystery based treasure hunt which requires participants to decode clues with logical reasoning.\n\n\n\n.\n\n\n',77.40835100,23.21629300,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 21:03:05','2017-10-01 21:03:05'),(19,'C-BAY','c-bay','competitions','NULL','An online coding competition where coding proficiency will be required to solve problems.\nPreliminary Round on hackerearth (Oct 11 , 2017 07:00 PM )\nOnsite First Round on Codechef (Oct 13, 2017 10:00 AM )\nOnsite Second Round (Oct 14, 2017)\n\n.\n\n\n',77.40563300,23.21637700,'2017-10-12 10:00:00','Anurag Gupta','anurag.gupta025@gmail.com','9806486834','NULL','Shiv Kumar','shivtelo@gmail.com','9955377130','','','2017-10-01 21:04:56','2017-10-10 16:46:34'),(20,'Tech Enigma 2.0','tech-enigma-20','competitions','https://drive.google.com/open?id=0B3E0HVQvXgXVNV9faElvZ2lLQk0','Tech Enigma puts forth, a technical conundrum that requires rigorous brainstorming to be solved. It\'s for those geeky minds who have the zeal to pick out the not so obvious. You will be  working out your minds and then debug a circuit provided to you. Detective Conan wants you to deduce the mind boggling mysteries before you . Pick out best tools from your arsenal to debug the faulty circuit as it is the key to the culprit.\n So brace yourselves to experience the next level of Tech Enigma.\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','Apoorv Lokhande','lokhandeapoorv@gmail.com','8349541928','NULL','Ayush Tripathi','ayusht2396@gmail.com','9455525935','','','2017-10-01 21:06:11','2017-10-08 17:05:09'),(21,'Electrobuzz 3.0','electrobuzz-30','competitions','https://drive.google.com/open?id=0B3E0HVQvXgXVMTVCNEJTcksySzg','Do you like solving mysteries?\nIf yes then this is the place you must come. \nThis brainstorming event is for you.\nLife has never been easy in 221B, Bakers Street. Moriarty has hidden 5 bombs across the city. He is contacting Sherlock through a dumb person who can only make drawings. Sherlock has to understand the hints and solve it to reach to the destination since he can’t do both at the same time so inspector Lestard is following the places on Sherlock’s instruction. Dr Watson as usual is helping Sherlock.  Come and be the part of the unsolved mystery…… as Sherlock always says THE GAME IS ON……….\n\n\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','Abhishek Ranjan Singh','arscool.singh@gmail.com','8269535645','NULL','Ankit Verma','ankitverma1510@gmail.com','8840754424','','','2017-10-01 21:07:16','2017-10-08 17:03:31'),(22,'CircuitRun 3.0','circuitrun-30','competitions','https://drive.google.com/open?id=0B3E0HVQvXgXVU1AzY1lGdlUtb0U','If you are a \"Kindaichi\" looking for a quest, if the word \"adventure\" makes adrenaline rush through your body, if you want to explore your knowledge or just want to play with some captivating circuits-CIRCUIT RUN is what might catch your fancy. It is a team game in which you are supposed to hunt down the treasures.\n',77.40871100,23.21784200,'0000-00-00 00:00:00','Vedant Singh','vedantsingh1595@gmail.com','9165632290','NULL','Umang Mittal','','8058827744','','','2017-10-01 21:07:54','2017-10-08 17:02:28'),(23,'CODE KRIEGERS','code-kriegers','competitions','NULL','A 3-Tier competition where preliminary round (TreasureHunt-cum-CodeHunt) culminate by solving the code to reach a destination using the knowledge of Basic Programming.\nHere, participants will be mercenary soldiers who will have to finish the given assassination job by making effective use of coding and programming grip and comprehension.\n\n\n\n',77.40835100,23.21629300,'0000-00-00 00:00:00','Ayush Rathi','ayushrathi18@gmail.com','9461304727','NULL','Anuj Gupta','anupta45@gmail.com','8989859127','','','2017-10-01 21:12:25','2017-10-07 17:13:37'),(24,'SWAANG','swaang','competitions','NULL','Come and explore the hidden you. Bend your wits and speak your mind.We invite humor in every form.\n\n',77.40628100,23.21548700,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 21:13:39','2017-10-11 12:29:53'),(25,'QUIZZOTICA','quizzotica','competitions','NULL','An annual quiz competition that emphasises on the importance of General Awareness in the lives of Technocrats, in specific and public, broadly.\n\n',77.40871100,23.21784200,'0000-00-00 00:00:00','NULL','NUll@null.com','0','NULL','','','','','','2017-10-01 21:14:51','2017-10-01 21:14:51'),(26,'BAND NIGHT  ft. Chaar Hazaari','band-night-ft-chaar-hazaari','pronites','NULL','Chaar Hazaari is a Folk Rock band from Delhi. Since its inception in 2012, the band has grown interlacing contemporary, folk and classical music to create its inimitable sound. The lyrical themes of devotion, love, and nature find expression through the harmonizing fusion of traditional and western genres into Indian Folk and Modern Rock.\nThe music will attract you, the spirit will definitely make you stay. ',0.00000000,0.00000000,'2017-10-13 20:00:00','NULL','NULL@null.com','0','BAND NIGHT (13 OCT)','','','','','','2017-10-06 15:26:12','2017-10-06 15:26:59'),(27,'BAND NIGHT  ft. Nalayak band','band-night-ft-nalayak-band','pronites','NULL','DEFINED BY ITS ENCHANTING STAGE PERSONA, NALAYAK - THE BAND IS AN EMERGING, FIRST - OF - ITS KIND, INDEPENDENT ROCK BAND FROM CHANDIGARH. APPLAUDED FOR THE CRAZY ACTS AND STUPEFYING LIVE PERFORMANCES, NALAYAK\'S MUSIC GENTLY TEASES THE BIZARRENES OF THE ``MODERN SOCIETY``.',0.00000000,0.00000000,'2017-10-13 22:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:32:15','2017-10-06 15:32:15'),(28,'Laser Show','laser-show','pronites','NULL','Feel great extravaganza of laser lights with musical performances.',0.00000000,0.00000000,'2017-10-14 20:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:43:38','2017-10-06 15:43:38'),(29,'EDM NIGHT ft. Nina & Malika','edm-night-ft-nina-malika','pronites','NULL','Nina Shah and Malika Hayden are a female Dj duo.\nelectronic and dance music has been a major obsession for them, leading them to find their passion which is producing music and Djing. Their electric energy is contagious enough to get any party pumping!',0.00000000,0.00000000,'2017-10-14 21:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:49:11','2017-10-06 15:49:11'),(30,'DJ NIGHT ft. Zydec','dj-night-ft-zydec','pronites','NULL','Enjoy electronic and dance music with Zydec leading you to find your passion. \n',0.00000000,0.00000000,'2017-10-14 22:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:52:57','2017-10-06 15:52:57'),(31,'EDM NIGHT ft. DJ Carnivore','edm-night-ft-dj-carnivore','pronites','NULL','Abhishek Kale aka Carnivore is a professional DJ based out of New Delhi.\nDJ Carnivore never settles for \'good enough\', and he keeps exercising a stringent screening process with everything that he does to ensure that he creates that \"wow\" factor.',0.00000000,0.00000000,'2017-10-15 20:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:55:31','2017-10-06 15:55:31'),(32,'Artist Night ft. Hardy Sandhu','artist-night-ft-hardy-sandhu','pronites','NULL','Known for his charm and stellar performances, he has become the biggest hot property in the industry. \nEnjoy Stellar performances of Hardy Sandhu.',0.00000000,0.00000000,'2017-10-15 21:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 15:59:11','2017-10-06 15:59:11'),(33,'Cracker Show','cracker-show','pronites','NULL','Let\'s celebrate the closure of Central India\'s Biggest Technical Festival with Amazing Cracker show.',0.00000000,0.00000000,'2017-10-15 22:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-06 16:01:19','2017-10-06 16:01:19'),(34,'Mr. Nirmal Raghav (Head HR, IT and transformation at RICL Bhopal)','mr-nirmal-raghav-head-hr-it-and-transformation-at-ricl-bhopal','lectures','NULL','With over 23 years of experience in human resources, Nirmal Singh Raghav has equally contributed to\nthe private and public sector. Exploring elements of profession grew in diverse industries and\ngeographies. Creating change, handling unexpected, compliance to commitment and delivering business\nthrough spruced brand vibrancy. Positioned as Vice President in one of the true Indian transnational\nbusiness group called Aditya Birla he contributed the last five years in Idea Cellular and headed as HR for\nMP and now UP West Circle.\nHe will be delivering lecture on “conversational intelligence”.',0.00000000,0.00000000,'2017-10-15 11:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:50:56','2017-10-12 10:32:21'),(35,'Dr. AR KHAN (Founder: KSG, The premier institute for IAS examination in India)','dr-ar-khan-founder-ksg-the-premier-institute-for-ias-examination-in-india','lectures','NULL','Dr. Khan has been teaching for around 30 years. He had started his career as lecturer in University of\nDelhi. He has several research papers and books to his credit. Dr. Khan has been teaching General\nStudies to IAS aspirants and is very proud of the fact that almost every State and Union Territory in India\nhas civil servants who personally associate with him. His inspirational lectures are integral to success of\nthe students and encouraging them to fulfill their dreams. His vision, passion and eagerness to serve his\nprofession have changed the way the students think about their life and their career opportunities. He is\nan eloquent orator, an accomplished teacher and a well known trainer with strong academic\nbackground. Dr Khan a pioneer in using social media as an instrument to interact with students and one\nof the most followed educator in social media among the aspirants.\nIn the year 2016-17, every 3rd selected candidate in Indian Civil Services Examination conducted by\nUnion Public Service are from the KSG.',0.00000000,0.00000000,'2017-10-15 14:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:52:13','2017-10-12 10:33:26'),(36,'Mr. Bramhanand Reddy & Mr.Chandraseker Nageneni','mr-bramhanand-reddy-mrchandraseker-nageneni','lectures','NULL','This technosearch IEEE will help you to find what it means to be a technocrat by introducing you to the\nreal technocrats.\n1. Mr. Bramhanand Reddy, Senior Manager, Crompton Greaves\n2. Mr.Chandraseker Nageneni, Senior Manager, Crompton Greaves\nBoth the guest lectureres have more than 10 years of industrial experience.\nTopic of Lecture: “Modern converters in traction applications”',0.00000000,0.00000000,'2017-10-14 10:30:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:53:55','2017-10-12 10:34:07'),(37,'Mr. Pranay Rawat (Managing Director, EDUNIRVANA Group)','mr-pranay-rawat-managing-director-edunirvana-group','lectures','NULL','Possess over seven years of experience in Training and Education Industry.Armed with an MBA and MS\nin Technology Innovation and Entrepreneurship, University of Colorado, Denver; he has entrusted upon\nhimself the arduous task of leading Edunirvana to become one stop destination for all solutions related\nto Global Education.\nHis professional experience includes organizations such as JP Morgan, DSK Global Education Private\nLimited and MAAC. His astute and individualized counseling has ensured innumerable students\nrediscovering their career ambitions and realizing them.\nHe is actively engaged in outdoor sports activities. He has run numerous marathons in India and abroad.\nHe maintains his own library that boasts books of inspirational leaders – Steve Jobs, Benjamin Franklin,\nRobin Sharma, etc.',0.00000000,0.00000000,'2017-10-15 15:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:54:33','2017-10-12 10:35:07'),(38,'Mr. Shyam Srivastava (Major General)','mr-shyam-srivastava-major-general','lectures','NULL','Major General Shyam Srivastava (Retd.) joined the Indian Army in 1978 and topped the commissioning\ntraining (for Technical Graduates) and won Technical Silver Medal during his passing out. In Army, he\nmajored in Electronics with specialization in Radars and super specialization in Non Com Electronics\nWarfare from Sunnyvale, California, USA.\nHe has held Commands, Staffs, and instructional apppointements during his service and worked for\nIGDMP (Integrated Guided Missile Development Program) at DRDl Hyderabad, where he headed the QA\nteam, initially for Prithvi and then for Agni missile system for three years. He was commanded Army’s\nprestigious Electronic Army Base Workshop. He was Dean of Faculty of Electronics at Military College at\nSecundarabad. After retirement, he worked as Director for Rolta India Limited for two years. Presently\nhe is running “Nisham Coaching Classes and Career Planning Institute” at Bhopal. He played an\nimportant role in planning and establishing ROLTA-MANIT Incubation Center at MANIT Bhopal.\nHe will be delivering lecture on “Induction into the Armed Forces - Lead a different life style”.',0.00000000,0.00000000,'2017-10-15 09:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:55:18','2017-10-12 07:55:18'),(39,'Mr. Rupesh Sizaria (Program Manager, TCS)','mr-rupesh-sizaria-program-manager-tcs','lectures','NULL','Mr. Rupesh has more than 20 years of experience in IT Industry in reputed organizations like Bharti\nTelenet, Zensar, HCL, Ford Motors and TCS. He has been with TCS for 13 years and have played variety of\nroles as a Project manager and Program Manager managing complex and large IT engagements.\nHe is a certified Prince2 Practitioner and Certified in Oracle Business Intelligence Suit 11g.\nMr. Rupesh is currently working as a Program manager for a TCS engagement at Bhopal.\nHis session would be around \"Recent Digital Trends in IT Industry \".',0.00000000,0.00000000,'2017-10-15 10:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 07:55:58','2017-10-12 07:55:58'),(40,'riddle of sand','riddle-of-sand','competitions','NULL','far more tantalizing. This Technosearch, dive deep into an ocean of mysteries, unravel mindboggling secrets, broaden the horizons of your perspective and rediscover your true self, with IBC’s yet another captivating creations, “Riddles of Sand – A struggle through the maze of conflicting identities.”',0.00000000,0.00000000,'2017-10-13 09:00:00','Varun Gupta','NULL@null.com','9413286141','NULL','Kanupriya Namdeo','','7828797422','','','2017-10-12 10:53:54','2017-10-12 11:39:34'),(41,'Mercy Rider 2.0','mercy-rider-20','competitions','NULL','NULL',0.00000000,0.00000000,'0000-00-00 00:00:00','VIRAJ','NULL@null.com','9479953631','NULL','DIVYA','','8965054347','','','2017-10-12 11:23:12','2017-10-12 11:23:12'),(42,'DIVERTIDO','divertido','competitions','https://drive.google.com/file/d/0B7bshxERFz0dY2dTUkZ5Q2NRbzlnYlQ4UGxlY2c3Ri1pSlZN/view?usp=sharing','This event consists of three rounds. It will be completed in 3 days, consisting of the fun\n+socially related tasks. The team should register in the member of two.\nYou can see More details in Problem Statement.',0.00000000,0.00000000,'0000-00-00 00:00:00','Sucheta Singh','NULL@null.com','7694818669','NULL','','','','','','2017-10-12 11:33:20','2017-10-12 11:33:20'),(43,'Treasure Hunt','treasure-hunt','competitions','NULL','1- Different tasks are presented. Whoever solves the problems correctly by or combining the solutions and finds the treasure has won.\n2- Make up some clues/tasks which always lead to the next step/leads to the next task',0.00000000,0.00000000,'0000-00-00 00:00:00','Seema Tirkey','NULL@null.com','09617796566','NULL','Pawan Baderia','','09669549129','','','2017-10-12 11:44:20','2017-10-12 11:44:20'),(44,'TechnoRiders','technoriders','competitions','NULL','This event is an edited version of Roadies and intends to bring out the pressure handling ability of the participants',0.00000000,0.00000000,'0000-00-00 00:00:00','kushagra anuragi','Kushagraanuragi22@gmail.com','7897257638','NULL','','','','','','2017-10-12 11:50:54','2017-10-12 11:50:54'),(45,'ARCH BRIDGE','arch-bridge','competitions','NULL','The competition aims to test the\nknowledge of participants in basic civil engineering through an\ninteractive quiz and then to test the arch bridges designed and\nmade using popsicle sticks by the participants, in terms of its\nefficiency(load bearing capacity) and aesthetic value.',0.00000000,0.00000000,'0000-00-00 00:00:00','Aviral Singhal','null@gmail.com','8602139142','NULL','Pranav ','','7868503448','','','2017-10-12 11:59:43','2017-10-12 11:59:43'),(46,'PARIVARTAN','parivartan','competitions','NULL','PARIVARTAN is a series of student-led simulations in an\nattempt to find solutions for the problems prevalent in\nour college. The event focuses on the betterment of\nMANIT through prolonged debating sessions to\nformulate ideas as solutions. In this way problems and\nsolutions put up by students will be collected in one\nplace and can be implemented by addressing to the\nconcerned authorities.',0.00000000,0.00000000,'0000-00-00 00:00:00','ATUL GARG','null@gmail.com','9755236855','NULL','PARVIND KUMAR','','','','','2017-10-12 12:03:54','2017-10-12 12:03:54'),(47,'Go Automotive','go-automotive','exhibitions','NULL','NULL',0.00000000,0.00000000,'0000-00-00 00:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 15:32:28','2017-10-12 15:32:28'),(48,'Internet Of Things','internet-of-things','workshops','NULL','The Internet of things (IoT) is the network of physical devices, vehicles, and other items embedded with electronics, software, sensors, actuators, and network connectivity which enable these objects to collect and exchange data.\nCome forward and know about IoT through experts.',0.00000000,0.00000000,'0000-00-00 00:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 15:36:23','2017-10-12 15:36:23'),(49,'Ecoside','ecoside','competitions','NULL','NULL',0.00000000,0.00000000,'0000-00-00 00:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 16:01:12','2017-10-12 16:01:12'),(50,'HUMORISTICO','humoristico','competitions','https://drive.google.com/open?id=0B3E0HVQvXgXVaThkZ1ZjNmFtNjg','This event consists of three rounds. It will be completed in 2 days, consisting of the fun +socially related tasks. The team should register in the member of two.\nYou can check further details in Problem Statement.',0.00000000,0.00000000,'0000-00-00 00:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-12 17:30:14','2017-10-12 17:30:14'),(51,'Kumar Kaushik (Writer, Motivator)','kumar-kaushik-writer-motivator','lectures','NULL','Kumar Kaushik is a Novelist, Poet Lyricist and Motivator, who writes in English as well as in Hindi. His 04 books have already been published and the name his recent book is “The Don of Darbhanga – New York Connection”. His has having Musical Channel on YouTube named Yellow Rose which is having more than 07 original songs and still counting. He is having qualification and experience in HR as well Political Science, but he still find the time for his creative pursuit.\n\nHe style of writing is different from other authors as he writes not only for the sake of writing but to give words his soulful feelings, so every time you read him, you will also feel that words written by him have come from very deep ocean of the soul of human emotions. \n\nEven there are reflections of vivid shades of reality which other recent authors missed out. He always finds hope, deep love and positive approach in the all situations. His originality and distinctive soulfulness make him apart from most of his contemporary authors and thinkers.',0.00000000,0.00000000,'2017-10-15 18:00:00','NULL','NULL@null.com','0','NULL','','','','','','2017-10-13 13:01:00','2017-10-13 13:01:00');
